description: !ruby/object:ProtocolDataset::DataSetDescription 
  name: NCIA_Rep739x5
  references:
    "10.26434/chemrxiv.13414931": "Kriz, Novacek and Rezac, Chemrxiv preprint, 2020"
  text: "CCSD(T)/CBS interaction energies for repulsive contacts in extended chemical space"
  method_geometry: "Non-equilibrium geometries constructed from fozen monomers"
  method_energy: |
    Composite CCSD(T)/CBS, CP-corrected, Helgaker extrapolation, frozen core:
    HF/aug-cc-pV5Z
    dMP2/aug-cc-pVQZ -> aug-cc-pV5Z
    dCCSD(T)/heavy-aug-cc-PVTZ

  units: kcal/mol

  groups_by: by the type of the interaction
  groups:
    - HCNO
    - PS
    - Halogens
    - NobleGases
  
  global_setup:
    job: interaction
    molecule_a:
      selection: "auto"
      charge: 0
      multiplicity: 1
    molecule_b:
      selection: "auto"
      charge: 0
      multiplicity: 1

